window.bookSummaryJSON = "<p>The end of privacy as we know it? Kathy Kelver nearly trips over a murder victim on her way back to her dorm room late one night. In his last words, the dying man gives her stolen data about a secret project that could blow the lid off a shocking conspiracy. From the halls of Congress to the National Security Agency and beyond, Kathy must run for her life from shadowy forces who want her dead, while trying to build a relationship and hang on to her faith. The secret she's carrying could end the right to privacy forever, if she doesn't survive to warn the world.</p>"; 
